import React, { useContext } from 'react';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { Container, Paper } from '@mui/material';
import Button from '@mui/material/Button';
import TableContainer from '@mui/material/TableContainer';
import { Link } from 'react-router-dom';
import '../index.css';
import AuthContext from "../context/AuthProvider";

const criterias = [
  {
    value: 'description',
    label: 'Description',
  },
  {
    value: 'author',
    label: 'Author',
  },
];

export default function Data() {
  const auth = useContext(AuthContext);
  const jwtToken = auth.jwtToken;
  console.log(auth);
  var description = ""
  var author = ""
  const [Search, setSearch] = React.useState('')
  const [Keyword, setKeyword] = React.useState('')
  const [searchResults, setSearchResults] = React.useState([])
  const handleClick = (e) => {
    if (Search) {
      if (Keyword === "description") {
        description = Search;
        author = '';
      } else {
        author = Search;
        description = '';
      }

      const url = `http://localhost:8080/search?author=${author}&description=${description}&uniqueMenuId=true`;
      console.log(jwtToken);
      fetch(url, {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${jwtToken}`, // Add the bearer token here
        },
      })
        .then(response => response.json())
        .then(data => {
          setSearchResults(data);
        })
        .catch(error => {
          console.error('Error fetching search results:', error);
        });
    }


  };

  const rowSt = {
    display: 'grid', gridTemplateColumns: '1fr 1fr',
    alignItems: 'center', padding: '2px', borderBottom: '1px solid black',
  };

  const headSt = {
    fontSize: '1em',
    fontWeight: 'bold'
  };

  return (
    <Container>
      <div style={{ height: "90px" }} />
      <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr' }}>
        <Paper
          elevation={3}
          style={{
            width: 'fit-content',
            height: 'fit-content',
            display: 'grid',
            gridTemplateColumns: '1fr',
            padding: '2em',
            marginBottom: '2em',
            borderRadius: '10px', // Add a border radius for a modern look
            backgroundColor: '#ffffffdd', // Add a semi-transparent white background
            boxShadow: '0 8px 32px 0 rgba(31, 38, 135, 0.37)', // Add a shadow effect
          }}
        >
          <form
            component="form"
            noValidate
            autoComplete="off"
          >
            <TextField
              id="filled-select-currency"
              style={{ marginRight: '0.5em', width: 'fit-content' }}
              select
              label="Select"
              defaultValue="Keywords"
              helperText="Search Category"
              variant="filled"
              value={Keyword}
              onChange={(e) => setKeyword(e.target.value)}
            >
              {criterias.map((option) => (
                <MenuItem key={option.value} value={option.value}>
                  {option.label}
                </MenuItem>
              ))}
            </TextField>
            <TextField
              required
              id="filled-required"
              style={{ width: 'fit-content' }}
              label="Required"
              variant="filled"
              value={Search}
              onChange={(e) => setSearch(e.target.value)}
            />
          </form>
          <Button variant="contained" disabled={!{ Search }} onClick={handleClick}
            style={{ width: 'fit-content', margin: '2em' }}
          >
            Search
          </Button>
        </Paper>

        <div>
          {searchResults.map((result) => (
            <div
              key={result.id}
              className="box-container"
              style={{
                // Add styling for each result box
                backgroundColor: '#ffffff',
                borderRadius: '10px',
                padding: '1em',
                marginBottom: '2em',
                boxShadow: '0 8px 16px -8px rgba(0, 0, 0, 0.3)',
              }}
            >
              {/* Render the content of each Data object */}
              <TableContainer component={Paper} sx={{ maxWidth: '30vw', margin: 'auto', marginBottom: '2em' }}>
                <Link to={`/details/${result.menu.menuId}`}>
                  <div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Author :
                      </div>
                      <div>
                        {result.author}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Department :
                      </div>
                      <div>
                        {result.menu.application.function.department.departmentName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Function :
                      </div>
                      <div>
                        {result.menu.application.function.functionName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Application :
                      </div>
                      <div>
                        {result.menu.application.applicationName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Menu :
                      </div>
                      <div>
                        {result.menu.menuName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Description :
                      </div>
                      <div>
                        {result.menu.description}
                      </div>
                    </div>
                  </div>
                </Link>
              </TableContainer>

            </div>
          ))}
        </div>
      </div>
      <div style={{ height: "30px" }} />
    </Container>
  );
}
